import React from 'react';
import {Card, Button, Image} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../../src/app.css';

import Compass from "../resources/icons/svg/Compass.svg";
import Pawprint from "../resources/icons/svg/Pawprint.svg";
import Book from "../resources/icons/svg/Book_animated.svg";
import Team from "../resources/icons/svg/Team.svg";
import Contact from "../resources/icons/svg/Contact.svg";


class Sidebar extends React.Component{
    render(){
        return(
        <div className="main-sidebar">
            <Link to="/feed"><div className="sidebar-button"><Image src={Compass} width="100"/></div></Link>
            <Link to="/projects"><div className="sidebar-button"><Image src={Pawprint} width="100"/></div></Link>
            <Link to="/bookstack"><div className="sidebar-button"><Image src={Book}  width="100" /></div></Link>
            <Link to="/team"><div className="sidebar-button"><Image src={Team} width="100"/></div></Link>
            <Link to="/contact"><div className="sidebar-button"><Image src={Contact} width="100"/></div></Link>
        </div>
        );
    }   
    
    
}

export default Sidebar;
